import React, { useState, useEffect } from 'react';
import './Projects.css';

const Projects = ({ theme }) => {
  const [selectedProject, setSelectedProject] = useState(null);

  const projects = [
    {
      id: 1,
      title: "HelpSeek",
      description: "A comprehensive lost and found platform that helps people reconnect with their lost items through community support and advanced matching algorithms.",
      image: "/project-images/HelpSeekLostPage.png",
      github: "https://github.com/nyanaung/helpseek",
      live: "https://helpseek.vercel.app",
      details: "#",
      tech: [
        { name: "React", icon: "/icons/React.svg" },
        { name: "Node.js", icon: "/icons/Node.js.svg" },
        { name: "MongoDB", icon: "/icons/MongoDB(color).svg" },
        { name: "Express", icon: "/icons/Express.svg" },
        { name: "JavaScript", icon: "/icons/JavaScript(color).svg" }
      ]
    }
  ];

  useEffect(() => {
    const wrapper = document.getElementById('wrapper');
    if (!wrapper) return;

    const handleScroll = () => {
      const scrollLeft = wrapper.scrollLeft;
      const maxScrollLeft = wrapper.scrollWidth - wrapper.clientWidth;

      wrapper.classList.toggle('at-left-edge', scrollLeft <= 0);
      wrapper.classList.toggle('at-right-edge', scrollLeft >= maxScrollLeft - 1);
    };

    wrapper.addEventListener('scroll', handleScroll);
    handleScroll(); // Initial check

    return () => wrapper.removeEventListener('scroll', handleScroll);
  }, []);

  const handleProjectClick = (projectId) => {
    setSelectedProject(selectedProject === projectId ? null : projectId);
  };

  return (
    <section 
      id="projects" 
      className="projects-section"
      style={{
        '--projects-bg': theme === 'dark' ? '#0a1f1a' : '#f8f9fa',
        '--projects-title-color': theme === 'dark' ? '#bd9f67' : '#2563eb',
        '--text-shadow-1': theme === 'dark' ? '#8b7355' : '#1d4ed8',
        '--text-shadow-2': theme === 'dark' ? '#6b5b47' : '#1e40af',
        '--text-shadow-3': theme === 'dark' ? '#4a4039' : '#1e3a8a',
        '--text-shadow-4': theme === 'dark' ? '#292527' : '#1d2b69'
      }}
    >
      <div className="projects-container">
        <div className="projects-content">
          <div className="projects-header">
            <h2 className="projects-title">Projects</h2>
          </div>

          <div id="wrapper">
            {projects.map((project) => (
              <div
                key={project.id}
                className={`window ${selectedProject === project.id ? 'selected' : ''}`}
                onClick={() => handleProjectClick(project.id)}
                style={{
                  backgroundImage: `url(${project.image})`,
                  backgroundSize: 'cover',
                  backgroundPosition: 'center',
                  backgroundRepeat: 'no-repeat'
                }}
              >
                <div className="window-content">
                  <h3 className="project-title">{project.title}</h3>
                  <p className="project-description">{project.description}</p>

                  <div className="project-links">
                    <a 
                      href={project.github} 
                      target="_blank" 
                      rel="noopener noreferrer"
                      className="project-link github-link"
                      onClick={(e) => e.stopPropagation()}
                    >
                      <img 
                        src="/icons/GitHub.svg" 
                        alt="GitHub" 
                        className="link-icon"
                      />
                    </a>

                    <a 
                      href={project.live} 
                      target="_blank" 
                      rel="noopener noreferrer"
                      className="project-link live-link"
                      onClick={(e) => e.stopPropagation()}
                    >
                      Live Demo
                    </a>

                    <a 
                      href={project.details} 
                      className="project-link details-link"
                      onClick={(e) => e.stopPropagation()}
                    >
                      Details
                    </a>
                  </div>

                  <div className="tech-stack">
                    {project.tech.map((tech, index) => (
                      <div key={index} className="tech-icon" title={tech.name}>
                        <img src={tech.icon} alt={tech.name} />
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
